export default (state = "", action) => {
  switch (action.type) {
    case "DIFFICULTY_EASY":
      return action.payload;
    case "DIFFICULTY_MEDIUM":
      return action.payload;
    case "DIFFICULTY_HARD":
      return action.payload;
    default:
      return state;
  }
};
